window.bookSummaryJSON = "<p><b>Eddie:</b> Cancel your dinky-little roomette on the train. I’m booking us two of the big bedroom suites. </p> <p><b>Birdie:</b> I’ll cancel it <i>after </i>you’ve booked the other sleeper rooms. And reimburse you. </p> <p><b>Eddie:</b> Don’t worry about it. Just cancel your tickets. I got this. Round trip. I’m on the Amtrak website right now. </p> <p><b>Birdie:</b> You don’t have to leave NYC when I do! You’ll hardly be able to spend any time with your Instagram girlfriend who you've never met! </p> <p><b>Eddie:</b> It’s fine. She’ll be fine with it. Cancel your tickets. </p> <p><b>Birdie:</b> You aren’t going to stop texting me until I’ve canceled them, are you?</p> <p><b>Eddie:</b> Damn right I’m not. Just do it. You can thank me later....</p> <p><b>Eddie:</b> Um. Did you cancel your tickets? </p> <p><b>Birdie:</b> Yes, Edward. I canceled them. </p> <p><b>Eddie:</b> Okay, because it turns out they only had one family bedroom from LA to Chicago. But the good news is I booked it for us. It’s the biggest room they had. The bad news is I booked it for us. And it’s the only sleeper room they have left now. </p> <p><b>Eddie:</b> In related news, there was also only one room left from Chicago to New York. </p> <p><b>Eddie:</b> Hands up if you’re excited! <i>*man raising hand emoji* </i></p> <p><b>Birdie:</b> I am so mad at you right now....</p> <p><b>Birdie:</b> I’ve compiled a list of ground rules re: shared train bedroom. Check your email; please read carefully; and refer to it again on the ninth of February. Thank you. </p> <p><b>Eddie:</b> <i>*nerd face emoji* </i>Received. I have some notes. </p> <p><b>This audiobook has dual narration, with portions that are duet-style.</b></p>"; 
